          await db.Book.create({
            id: book.upc,
            title: book.bookTitle,
            price: +book.bookPrice,
            available: +book.available,
            image: book.imageUrl,
            description: book.bookDescription,
            category_code: generateCode(item[0]),
          });
        });
      });
      resolve("OK");
    } catch (error) {
      reject(error);
    }
  });

