// import db from "../models";
// import { Op } from "sequelize";
// import { v4 as generateId } from "uuid";

// export const getTitle = ({ name, ...query }) =>
//   new Promise(async (resolve, reject) => {
//     try {
//       const queries = { raw: true, rest: true };

//       if (name) query.title = { [Op.substring]: name };

//       // ham tim kiem
//       const response = await db.Title.findAll({
//         attributes: ["title"], // Ch ly trng 'title'
//         where: query,
//         ...queries,
//         include: [
//           {
//             model: db.Work,
//             attributes: {
//               exclude: ["createdAt", "updatedAt"],
//             },
//             as: "workData",
//           },
//         ],
//       });

//       resolve({
//         err: response ? 0 : 1,
//         mes: response ? "Get" : "Cannot found books",
//         bookData: response,
//       });
//     } catch (error) {
//       reject(error);
//     }
//   });
import { query } from "express";
import db from "../models";
import { Op } from "sequelize";

export const getTitle = async ({ ...query }) =>
  new Promise(async (resolve, reject) => {
    try {
      const queries = { raw: true, rest: true };
      console.log(1);
      const response = await db.Title.findAll({
        where: query,

        attributes: {
          exclude: ["code"],
        },
        include: [
          {
            model: db.Work,
            attributes: {
              exclude: ["createdAt", "updatedAt"],
            },
            as: "id_Title",
          },
          // {
          //   model: db.Comment,
          //   attributes: {
          //     exclude: ["createdAt", "updatedAt"],
          //   },
          //   as: "id_Cmt",
          // },
        ],
      });

      resolve({
        err: response ? 0 : 1,
        mes: response ? "Got" : "Cannot found titls",
        titleData: response,
      });
    } catch (error) {
      reject(error);
    }
  });

